import REturnQuote from './Quote';
import REturniCons from './Icon';
import { AiFillBank } from 'react-icons/ai';

// view Box 
export default function REturnBox() {
 return (
  <div className='wrp-box-sol'>

   <div className='wrp-subbox-sol'>
    <REturniCons icons={<AiFillBank size={'1.2em'} />} />
    <REturnQuote />
   </div>

  </div>
 );
};
